"</style></head><body style=\" font-family:\'MS Shell Dlg 2\'; font-size:10pt; font-weight:400; font-style:normal;\" bgcolor=\"#191919\">\n"
"<p align=\"center\" style=\" margin-top:20px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"welcome-to-urdfast-nbsp-\"></a><span style=\" font-family:\'Helvetica\'; font-size:22pt; font-weight:600; color:#03c3f5;\">W</span><span style=\" font-family:\'Helvetica\'; font-size:22pt; font-weight:600; color:#03c3f5;\">elcome to URDFast !</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">Here is the user manual to get you started !</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">You can access it here for better readability :</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a href=\"https://github.com/Teskann/URDFast/blob/master/documentation/usermanual.md\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">https://github.com/Teskann/URDFast/blob/master/documentation/usermanual.md</span></a></p>\n"
"<p style=\" margin-top:16px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"main-window\"></a><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">M</span><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">ain window</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The window is divided in three parts :</span></p>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Robot Information</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Code Generator</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Settings</li></ul>\n"
"<p align=\"justify\" style=\" margin-top:14px; margin-bottom:15px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"open-a-file\"></a><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">O</span><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">pen a File</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">To open a file, simply click on the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">OPEN URDF FILE</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> button at the top center or click on </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">File &gt; Open</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> (</span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">Ctrl + O</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">).</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This should open a file dialog in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Examples</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> directory. You can pick one of the files in here to try the software or open your own URDF file.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">File openning can take a few seconds, especially if you have exotic joints transformations. This is normal and if your OS says URDFast is not responding, just wait, it shouldn\'t have crashed. The progress bar at the bottom will give you an idea of the remaining time.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:14px; margin-bottom:15px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"robot-information-left-\"></a><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">R</span><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">obot Information (left)</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This section contains the robot information. You can not edit content in this section.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The &quot;</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Description</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">&quot; tab is a text area where you can see some details about your robot :</span></p>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Robot Name</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Number of Joints</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Number of Links</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\">Total Mass</li></ul>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The &quot;</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Tree Representation</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">&quot; tab displays the tree representation of the robot. Take a look at it to check if it corresponds to the architecture your URDF file is supposed to describe. There shouldn\'t be bugs here, if the architecture is not correct, your URDF file is probably wrong.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:14px; margin-bottom:15px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"code-generator-middle-\"></a><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">C</span><span style=\" font-family:\'Helvetica\'; font-size:11pt; font-weight:600; color:#efefef;\">ode Generator (middle)</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This section is the heart of the software. It is where you select what you want to generate. It is composed of 4 tabs.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"transition-matrices\"></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">T</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">ransition Matrices</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This is where you select which transition matrices you want to generate. Transition matrices are expressed as 4x4 matrices in </span><a href=\"https://en.wikipedia.org/wiki/Homogeneous_coordinates\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">homogeneous coordinates</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. They are associated with joints. If a joint </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> links two links </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L2</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">, the forward transition matrix associated to </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> is the expression of </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L2</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> coordinates in the </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">frame. The backward transition matrix associated to </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> is the expression of </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> coordinates in the </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L2</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">frame (this is actually the invert of the forward one). These matrices can depend on variables if </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> has degrees of freedom.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">By default, when you open a file, all joints are preselected for generation, forward and backward. You can remove some of them if you don\'t need them clicking on </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Remove Selected</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> (multiple selection is allowed). To add a joint, select it in the combo box and click </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Add</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. Note that you can\'t add a joint that is already in the list.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">You have to check the checkboxes if you want the code to be generated.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"forward-kinematics\"></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">F</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">orward Kinematics</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This where you select which </span><a href=\"https://en.wikipedia.org/wiki/Forward_kinematics\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">forward kinematics</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> functions you want to generate. The forward kinematics are expressed as 4x4 matrices in </span><a href=\"https://en.wikipedia.org/wiki/Homogeneous_coordinates\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">homogeneous coordinates</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">Let\'s suppose a robot has the chain </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1 =&gt; J1 =&gt; L2 =&gt; ... =&gt; JN-1 =&gt; LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> where </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">Lk</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">are links and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">Jk</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> are joints for all </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">k</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> in </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">{1, ... , N}</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. The forward kinematics function having </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as origin and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as destination will return the coordinates of </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> in </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> frame. The forward kinematics function having </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as origin and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as destination will return the coordinates of </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> in </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> frame.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The code generated by this tool will call transition matrices functions associated with all the joints in the chain between the origin and destination. In the example above, the generated code will call transition matrices for </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J1, ..., JN-1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">Make sure to generate these functions in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; font-style:italic; color:#efefef;\">Transition Matrices</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\"> tab or the code will call functions that are not defined</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">By default, when you open a file, all the paths from the root link of the robot to all the leaf links of the robot are preselected for generation. You can remove them clicking on </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Remove Selected</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> (multiple selection is allowed). To add a forward kinematics function, select an origin object in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">origin</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> combo box and a destination object in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">destination</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> combo box. Then, click </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Add</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. Note that you can\'t add a forward kinematics function that is already in the list.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"jacobians\"></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">J</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">acobians</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">This where you select which </span><a href=\"https://en.wikipedia.org/wiki/Jacobian_matrix_and_determinant\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">Jacobian matrices</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> functions you want to generate. The jacobians are expressed as 6xN matrices where N is the number of degrees of freedom of the robot between the origin and the destination (terms defined below).</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">Let\'s suppose a robot has the chain </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1 =&gt; J1 =&gt; L2 =&gt; ... =&gt; JN-1 =&gt; LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> where </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">Lk</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">are links and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">Jk</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> are joints with one degree of freedom for all </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">k</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> in </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">{1, ... , N}</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. The jacobian function having </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as origin and </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> as destination will return the derivative of the coordinates of </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">LN</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> in </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">L1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> frame with respect to all the </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">N</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> degrees of freedom as follows :</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">/ dX              dX  \\</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> ---     ...     --- </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dD1             dDN </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">                     </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dY              dY  </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> ---     ...     --- </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dD1             dDN </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">                     </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dZ              dZ  </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> ---     ...     --- </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dD1             dDN </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">                     </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dR              dR  </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> ---     ...     --- </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dD1             dDN </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
