"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">where :</span></p>\n"
"<ul style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;\"><li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">d</span> represents the differentiation operator, </li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">X</span>, <span style=\" font-family:\'Courier New\';\">Y</span> and <span style=\" font-family:\'Courier New\';\">Z</span> are the cartesian coordinates of <span style=\" font-family:\'Courier New\';\">LN</span> in the <span style=\" font-family:\'Courier New\';\">L1</span> frame,</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">R</span>, <span style=\" font-family:\'Courier New\';\">P</span> and <span style=\" font-family:\'Courier New\';\">y</span> represent the roll, pitch and yaw of <span style=\" font-family:\'Courier New\';\">LN</span> in the <span style=\" font-family:\'Courier New\';\">L1</span> frame</li>\n"
"<li style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\" align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\';\">Dk</span> represents the variable associated with the degree of freedom of the joint <span style=\" font-family:\'Courier New\';\">k</span> for <span style=\" font-family:\'Courier New\';\">k</span> in <span style=\" font-family:\'Courier New\';\">{1, ... , N}</span>.</li></ul>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The code generated by this tool will call transition matrices functions associated with all the joints in the chain between the origin and destination. In the example above, the generated code will call transition matrices for </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">J1, ..., JN-1</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">Make sure to generate these functions in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; font-style:italic; color:#efefef;\">Transition Matrices</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\"> tab or the code will call functions that are not defined</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">By default, when you open a file, all the paths from the root link of the robot to all the leaf links of the robot are preselected for generation. You can remove them clicking on </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Remove Selected</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> (multiple selection is allowed). To add a jacobian function, select an origin object in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">origin</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> combo box and a destination object in the </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">destination</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> combo box. Then, click </span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-style:italic; color:#efefef;\">Add</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. Note that you can\'t add a jacobian function that is already in the list.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><a name=\"center-of-mass\"></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">C</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; font-weight:600; color:#efefef;\">enter of Mass</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">In this section, you will find two combo boxes to generate the center of mass function and its jacobian matrix.</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The center of mass is expressed as a 4x1 matrix in </span><a href=\"https://en.wikipedia.org/wiki/Homogeneous_coordinates\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">homogeneous coordinates</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">. The first three coordinates represent the cartesian coordinates of the center of mass of the robot in the world frame, and the 4th coordinate is always equal to 1. There is no way to change the frame for the expression of the center of mass yet. To express it in another frame, multiply the forward kinematics function going from the world frame to the desired frame by the center of mass vector. If the robot mass is null, the code is not generated as the center of mass is not defined. You have to write explicitly the mass of each link in the URDF file (the default mass for URDF links is 0 kg).</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:12px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\">The </span><a href=\"https://en.wikipedia.org/wiki/Jacobian_matrix_and_determinant\"><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; text-decoration: underline; color:#03c3f5;\">Jacobian matrix</span></a><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> of the center of mass is expressed as a 3xN matrix where N is the number of degrees of freedom of the robot that have an impact on the center of mass position. Here is what the matrix looks like :</span></p>\n"
"<p align=\"justify\" style=\" margin-top:12px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">/ dX              dX  \\</span></p>\n"
"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> ---     ...     --- </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
