"<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:20px; margin-right:20px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span><span style=\" font-family:\'Verdana,Geneva,Tahoma,sans-serif\'; font-size:11pt; color:#efefef;\"> dZ              dZ  </span><span style=\" font-family:\'Courier New\'; font-size:11pt; color:#efefef;\">|</span></p>\n"
